import './Women.css'
import DisplayLocations from '../../Extras/DisplayLocations';


function Women() {
   
  return (
    <div className="Women">
      <h1>Category Name</h1>
        <div className='boxes'>
              <div className="box">
                <h2>Task Works</h2>
                <DisplayLocations />
              </div>
        </div>
    </div>
  )
}

export default Women
